// 弹出遮罩层 显示豆芽贷二维码信息
var Ol_Dai360_pop = '<div id="dai360Pop"><div class="shadow"></div><div class="content"><a class="_close"><span class="close"></span></a></div>';
dBody.append(Ol_Dai360_pop);

//点击豆芽贷按钮显示遮罩层信息
$("body").on("click", "#dai360_link", function () {
    $("#dai360Pop").css("display", "block");
});

//点击遮罩层关闭信息
$("body").on("click", "#dai360Pop>.shadow", function () {
    $("#dai360Pop").css("display", "none");
});
//点击关闭按钮 关闭遮罩层信息
$("body").on("click", "#dai360Pop>.content>._close", function () {
    $("#dai360Pop").css("display", "none");
});
// 判断来源是否是淘宝  淘宝需要动态监听视窗修改样式
var pathName = window.location.href.toString();
if (pathName.indexOf("taobao") != -1) {
    function adjust() {
        var aw = $("#dypMid9527").width(),
            cw = $(".dypMid9527-font_inner1").width(),
            zw = aw - cw - 26;
        if (cw == 0) {
            zw = aw - 283;
        }
        if ($(window).width() < 1180) {
            $("#dai360_link>.dai360_title>span").css("display", "none");
            $("#dai360_link").css("width", zw + "px");
        } else {
            $("#dai360_link>.dai360_title>span").css("display", "inline-block");
            $("#dai360_link").css("width", zw + "px");
        }
    }

    window.onresize = adjust;
    adjust();
} else {
    var aw = $("#dypMid9527").width(),
        cw = $(".dypMid9527-font_inner1").width(),
        zw = aw - cw - 26;
    if (cw == 0) {
        zw = aw - 283;
    }
    $("#dai360_link>.dai360_title>span").css("display", "inline-block");
    $("#dai360_link").css("width", zw + "px");
}
